# https://leetcode.com/problems/01-matrix/

# Given a matrix consists of 0 and 1, find the distance of the nearest 0 for each cell.
# The distance between two adjacent cells is 1.

# The number of elements of the given matrix will not exceed 10,000.
# There are at least one 0 in the given matrix.
# The cells are adjacent in only four directions: up, down, left and right.
import time
class Solution(object):
    def updateMatrix(self, matrix):
        from collections import deque
        Li, Lj = len(matrix), len(matrix[0])
        num_lst = set((i, j) for i in range(Li) for j in range(Lj) if matrix[i][j])
        di = [0, 1, 0, -1]
        dj = [1, 0, -1, 0]
        while num_lst:
            i, j = num_lst.pop()
            visit = [[0]*Lj for _ in range(Li)]
            flag, visit[i][j] = 0, 1
            q = deque()
            q.append((i, j, 1))
            while q:
                si, sj, distance = q.popleft()
                for d in range(4):
                    ni, nj = si+di[d], sj+dj[d]
                    if 0 <= ni < Li and 0 <= nj < Lj and visit[ni][nj] == 0:
                        if matrix[ni][nj] == 0:
                            flag = 1
                            break
                        else:
                            visit[ni][nj] = 1
                            q.append((ni, nj, distance+1))
                if flag:
                    break
            matrix[i][j] = distance
        return matrix

    def updateMatrix2(self, matrix):
        from collections import deque
        Li, Lj = len(matrix), len(matrix[0])
        zero_lst = set((i, j) for i in range(Li) for j in range(Lj) if matrix[i][j] == 0)
        di = [0, 1, 0, -1]
        dj = [1, 0, -1, 0]
        visit = [[0] * Lj for _ in range(Li)]
        while zero_lst:
            i, j = zero_lst.pop()
            visit[i][j] = 1
            q = deque()
            q.append((i, j, 1))
            while q:
                si, sj, distance = q.popleft()
                for d in range(4):
                    ni, nj = si + di[d], sj + dj[d]
                    if 0 <= ni < Li and 0 <= nj < Lj and (visit[ni][nj] == 0 or visit[ni][nj] > distance):
                        visit[ni][nj] = distance
                        q.append((ni, nj, distance+1))
            print(visit)

    def sol1(self, matrix):
        m = len(matrix)
        n = len(matrix[0])
        dist = [[-1 for j in range(n)] for i in range(m)]
        visit = set()
        zeros = set((i, j) for i in range(m) for j in range(n) if matrix[i][j] == 0)
        distance = 0
        while zeros:
            print(dist)
            for (i, j) in zeros:
                dist[i][j] = distance
            distance += 1
            visit |= zeros
            # zeros중에서 4방향으로 범위 체크, visit 여부,
            zeros = set((i+di, j+dj) for (i, j) in zeros for (di, dj) in [(0, 1), (0, -1), (1, 0), (-1, 0)]
                        if 0 <= i+di < m and 0 <= j+dj < n and (i+di, j+dj) not in visit)
        return dist

